import React from 'react'
import NoteList from './NoteList'
import Inputs from './Inputs'



const addNote = () =>{
    alert('I am clicked')
}




const App = () =>{

    return(
        <>
        <div className="wrapper">
            <div className="container">
                <Inputs
                createNote = {addNote}
                />
                <NoteList/>
            </div>
        </div>
        </>
    )
}


export default App;
